import CoinPerCent from "./CoinPerCent";
import CoinPrice from "./CoinPrice";
import Id from "./Id";
// import Image from "./Image";
import MarketCap from "./MarketCap";
import Symbol from "./Symbol";

const Coin = (props) => {
  console.log(props);
  return (
    <>
      <CoinPerCent coinpercent={props.coinpercent} />
      <CoinPrice coinprice={props.coinprice} />
      <Id id={props.id} />
      {/* <Image image={props.image} /> */}
      <MarketCap marketcap={props.market_cap} />
      <Symbol symbol={props.symbol} />
    </>
  );
};

export default Coin;
